const Dashboard = () => {

  return (
    <div className="header">
      <div className="logo"></div>
      <div className="navigation">
        <ul>
        <li><Link to='/'>Dashboard</Link></li>
        <li><Link to='/addbook'>Add a book</Link></li>
        </ul>
      </div>
    </div>
  )
}

export default Header
